import requests
from utils.generate_env  import generate_env

def protect_decode():
    url = f"{generate_env()['api_module']}/decode"
    body={
        'encoded':""
    }
    response = requests.post(url, json=body)
    data = response.json()
    
    isProtec=""
    if data['message'] == 'Success':
        isProtec = True
    elif data['message'] == 'Error':
        isProtec = False
    return isProtec

